import React from "react";

const UserResume = ({ resume }) => {
  const {
    first_name,
    last_name,
    phone_number,
    address,
    designation,
    email,
    city,
  } = resume.about;
  return (
    <div className="flex justify-start items-start">
      <div className="flex bg-[#353535] flex-col p-10 ">
        <div className="underline">CONTACT</div>
        <div>{phone_number}</div>
        <div>{email}</div>
        <span>
          {address},{city}
        </span>
      </div>
      <div className="flex">
        <div>{first_name}</div>
        <div>{last_name}</div>
      </div>
    </div>
  );
};

export default UserResume;
